{{! /login }}

&lt;h1&gt;{{title}}&lt;/h1&gt;
&lt;p&gt;Welcome to {{title}}&lt;/p&gt;


&lt;div class="container-fluid"&gt;
  &lt;div class="row"&gt;
    &lt;div class="col-md-6 col-md-offset-3"&gt;
      &lt;h1 class="title-post"&gt;{{title}}&lt;/h1&gt;
      &lt;h4 class="header-post"&gt;Log In&lt;/h4&gt;
      &lt;form class="post-blog-form" action="/login/volunteer" method="POST"&gt;
        &lt;ul&gt;
          &lt;li&gt;
            &lt;label for="user_name"&gt;Username&lt;/label&gt;
            &lt;input type="text" name="user_name" placeholder="John Smith" require&gt;
          &lt;/li&gt;
          &lt;li&gt;
            &lt;label for="password"&gt;Enter Password&lt;/label&gt;
            &lt;input type="password" name="password" placeholder="************" require&gt;
          &lt;/li&gt;
          &lt;li&gt;
            &lt;input type="submit" class="submit-btn" name="loginVolSubmit" value="Submit" require&gt;
          &lt;/li&gt;
        &lt;/ul&gt;
      &lt;/form&gt;
    &lt;/div&gt;
  &lt;/div&gt;
&lt;/div&gt;

